    false,nt"url": null,nt"notes": "These data are summary statistics of abundances
    of birds counted within 100-m radius circles with 10-minute point counts at 15 sample
    points within Spears and Didion Ranches, Placer County, in the foothills of the
    Sierra Nevada Mountain Range. Bird surveys were conducted 1 April to 6 June 2005
    and 19 March to 23 June 2006. These data represent 539 detections of 69 species
    at 15 different sample points within these two ranches that are part of the Placer
    Legacy program.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
